import './App.css';
import {Routes, Route} from 'react-router-dom';
import Form from './modules/Form';
import Dashboard from './modules/Dashboard';
function App() {

  return (
    <Routes>
      <Route path='/users/sign_in' element={<Form isSignInPage/>}/>
      <Route path='/users/sign_up' element={<Form/>}/>
    </Routes>

  );
}

export default App;
